            requestHeaders[header] = value;
            originalXHR.prototype.setRequestHeader.call(xhr, header, value);
        };

        xhr.open = function(method, url) {
            this.addEventListener("loadstart", function() {
                interceptRequestHeaders(url, requestHeaders);
            }, false);
            originalXHR.prototype.open.call(xhr, method, url);
        };
        return xhr;
    };
    window.XMLHttpRequest = XHR;

    // Intercept Fetch API
    var originalFetch = window.fetch;
    window.fetch = function(input, init) {
        if (init && init.headers) {
            var headers = {};
            if (init.headers instanceof Headers) {
                init.headers.forEach(function(value, key) {
                    headers[key] = value;
                });
            } else {
                headers = init.headers;
            }
            interceptRequestHeaders(input, headers);
        }
        return originalFetch(input, init);
    };
})();"

"function waitForElement(selector) {
    return new Promise(resolve => {
        if (document.querySelector(selector)) {
            return resolve(document.querySelector(selector));
        }

        const observer = new MutationObserver(mutations => {
            const element = document.querySelector(selector);
            if (element) {
                resolve(element);
                observer.disconnect();
            }
        });

        observer.observe(document.body, {
            childList: true,
            subtree: true
        });
    });
