"async function waitForSelector(
    selector,
    text,
    document = window.document,
    attributes,
    timeout
) {
    let time;

    function checkElement(element) {
        if (!element) return false;
        if (!attributes) return true;
        return Object.keys(attributes).every((key) => {
            return element[key] === attributes[key];
        });
    }

    return new Promise((resolve, reject) => {
        const element = text
            ? Array.from(document.querySelectorAll(selector)).find((el) =>
                el.textContent.includes(text)
            )
            : document.querySelector(selector);
        if (checkElement(element)) {
            resolve(element);
            return;
        }

        const observer = new MutationObserver(() => {
            const element = text
                ? Array.from(document.querySelectorAll(selector)).find((el) =>
                    el.textContent.includes(text)
                )
                : document.querySelector(selector);
            if (checkElement(element)) {
                observer.disconnect();
                if (time) clearTimeout(time);
                resolve(element);
            }
        });

        observer.observe(document.documentElement, {
            childList: true,
            subtree: true,
            attributes: true,
        });
        if (timeout) {
            time = setTimeout(() => {
                observer.disconnect();
                const element = document.querySelector(selector);
                if (!checkElement(element)) {
                    console.error('waitForSelector timeout', selector);
                    reject('waitForSelector timeout ' + selector);
                }
            }, timeout);
        }
    });
}"

"function type(input, value) {
    try {
        input.dispatchEvent(new FocusEvent('focus'));
        input.focus();
        input.dispatchEvent(new KeyboardEvent('keydown'));
        input.dispatchEvent(new KeyboardEvent('keypress'));
        Object.getOwnPropertyDescriptor(
            window.HTMLInputElement.prototype,
            'value'
        ).set.call(input, value);
        input.dispatchEvent(
            new InputEvent('beforeinput', {
                data: value,
                inputType: 'insertText',
            })
        );
        let event = new InputEvent('input', {data: value, inputType: 'insertText'});
        event._source = 'KNOT_CRAWLER';
        input.dispatchEvent(event);
        event = new Event('input', {bubbles: true});
        event._source = 'KNOT_CRAWLER';
        input.dispatchEvent(event);
        input.dispatchEvent(new KeyboardEvent('keyup'));
        input.dispatchEvent(new Event('change', {bubbles: true}));
    } catch (e) {
        console.error('type error', e);
        sendSwitcherErrorCallback({
          errorMessage: 'error occurred',
        });
    }
}"

