function debounce(func, delay) {
    let debounceTimer;
    return function() {
        const context = this, args = arguments;
        clearTimeout(debounceTimer);
        debounceTimer = setTimeout(function() {
            func.apply(context, args);
        }, delay);
    };
}

function trackInputEvents () {
    const otpInputs = document.querySelectorAll('input[type="text"], input[type="number"], input[type="tel"]'); // Adjust the selector as needed

    const handleInput = debounce(function (event) {
        const input = event.target;
        const otpData = {
            id: input.id,
            classes: input.className,
            placeholder: input.placeholder,
        };
        window.webkit.messageHandlers.merchantTracking.postMessage({...otpData, eventType: 'OTP_INPUT'});
    }, 1500);

    otpInputs.forEach(function(input) {
        input.addEventListener('input', handleInput);
    });
}

